(24, 1, 'BusinessInformation', 'Address', 'Sitio Colonia Gabihan, San Ildefonso, Bulacan', '2025-07-03 00:38:51'),
(25, 1, 'BusinessInformation', 'ShortDesc2', 'Welcome to Mamyr Resort and Events Place, where relaxation and unforgettable moments await you. Whether you\'re here for a peaceful retreat or a special celebration, we\'re dedicated to making your experience truly exceptional.', '2025-10-08 21:09:30'),
(26, 1, 'About', 'Header', 'Compassionate Service, Unforgettable Family Moments', '2025-10-08 21:09:30'),
(27, 1, 'About', 'AboutMamyr', 'Mamyr Resort and Events Place is a peaceful getaway located in Gabihan, San Ildefonso, Bulacan, built on a story of resilience, love, and family. Before it became a resort, the land was used for pig farming. When the business faced financial challenges, owners Mamerto Dela Cruz and Myrna Dela Cruz looked for a new opportunityâ€”something that would not only support their family but also bring joy to others.', '2025-10-08 21:09:30'),
(28, 1, 'About', 'ServicesDesc', 'Mamyr isnâ€™t just a resort; itâ€™s a family-oriented getaway with comfortable rooms and a versatile event venue for gatherings and celebrations. It offers a relaxed, fun environment for all ages to enjoy.', '2025-10-08 21:09:30'),
(29, 1, 'About', 'Service1', 'Resort', '2025-10-08 21:09:30'),
(30, 1, 'About', 'Service1Desc', 'Mamyr features three refreshing pools, providing the perfect spots for family fun, relaxation, and leisurely swims.', '2025-10-08 21:09:30'),
(31, 1, 'About', 'Service2', 'Events Place', '2025-10-08 21:09:30'),
(32, 1, 'About', 'Service2Desc', 'Mamyrâ€™s versatile event venue offers a spacious and welcoming setting, ideal for family gatherings, reunions, and celebrations of all kinds.', '2025-10-08 21:09:30'),
(33, 1, 'About', 'Service3', 'Hotel', '2025-10-08 21:09:30'),
(34, 1, 'About', 'Service3Desc', 'Mamyrâ€™s cozy hotel features 11 comfortable rooms, perfect for a relaxing stay with family and friends.', '2025-10-08 21:09:30'),
(35, 1, 'About', 'Explore', 'At Mamyr Resort, we treat every guest like family, offering an experience that goes beyond just comfort. From our humble beginnings to the thriving retreat we are today, we\'ve poured our heart and soul into creating a sanctuary where nature and relaxation meet. Our story is built on passion, growth, and a deep commitment to providing an unforgettable experience. When you visit, youâ€™ll discover not just stunning surroundings and luxurious comfort, but the warm, welcoming spirit that defines us. Come join us and see firsthand what makes Mamyr Resort a place where memories are made, and guests feel right at home.', '2025-10-08 21:09:30'),
(36, 1, 'About', 'HistoryParagraph1', 'Mamyr Resort and Events Place is a peaceful getaway located in Gabihan, San Ildefonso, Bulacan, built on a story of resilience, love, and family. Before it became a resort, the land was used for pig farming. When the business faced financial challenges, owners Mamerto Dela Cruz and Myrna Dela Cruz looked for a new opportunityâ€” something that would not only support their family but also bring joy to others.', '2025-10-08 21:09:30'),
(37, 1, 'About', 'HistoryParagraph2', 'With faith and hard work, they transformed the land into a relaxing resort that people could enjoy. Their vision and dedication shaped the landscape into a serene retreat where visitors could unwind and create lasting memories. The name \"Mamyr\" came from their own namesâ€”Mamerto and Myrnaâ€”a symbol of the spirit of unity that brought the resort to life, making it not just a place to stay, but a reflection of their dreams and the love they poured into every corner of the property.', '2025-10-08 21:09:30'),
(38, 1, 'About', 'HistoryParagraph3', 'Opened in 2022, Mamyr Resort has become a popular and welcoming place for people looking to relax and enjoy nature. The resort is known for its clean swimming pools, spacious function areas, beautiful surroundings, and warm hospitality. Guests can enjoy the resort\'s three refreshing swimming pools, two elegant pavilions, cozy cottages to stay in, as well as 11 comfortable hotel rooms for those who prefer a more private stay, and a spacious parking lot to accommodate all guests conveniently.', '2025-10-08 21:09:30'),
(39, 1, 'About', 'HistoryParagraph4', 'At Mamyr Resort, we treat every guest like family, making sure your stay is special and enjoyable. Whether you\'re celebrating an important event, spending time with loved ones, or just looking for a peaceful break, we have everything you need to feel comfortable and relaxed. Our team works hard to create a warm and welcoming atmosphere where you can make lasting memories. Visit us and see for yourself why we\'re so proud of how much we\'ve grown.', '2025-10-08 21:09:30'),
(40, 1, 'BusinessInformation', 'FBLink', 'https://www.facebook.com/p/Mamyr-Resort-Restaurant-Events-Place-100083298304476/', '2025-10-08 21:09:30'),
(41, 1, 'BusinessInformation', 'GmailAdd', 'mamyresort128@gmail.com', '2025-10-08 21:09:30');

